import React from 'react';

const city  =[
  {id: 1, name:'Krakow'},
  {id: 2, name:'dupa'}
];

export const Stations = () =>{


  const listItems = city.map((station)=>
    <div key={station.name}>
      <p>{station.name}</p>
      <p>{station.id}</p>

    </div>


);

  return(
    <div>
      {listItems}
    </div>

  )
}
